export function dateFormater(dateString) {
  const date = new Date(dateSplice[0]).getDate();
  const month = getMonthName(new Date(dateSplice[0]).getMonth());
  const year = new Date(dateSplice[0]).getFullYear();
}

export function getMonthName(integerMonth) {
  const monthNames = [
    "January",
    "February",
    "March",
    "April",
    "May",
    "June",
    "July",
    "August",
    "September",
    "October",
    "November",
    "December",
  ];

  return monthNames[integerMonth];
}
